static void c03_activation(C03_DATATYPE *vec, int count)
{
	for(int k=0;k<count;++k)
	{
		C03_DATATYPE val=vec[k];
		if(val<0)//LeakyReLU
			val*=0.01f;
		vec[k]=val;
	}
}
